      "user_app_id": {
            "user_id": "ltbrp03abi48",
            "app_id": "f232d0bac678457aae0377bd2cf8cd13"
        },
      "inputs": [
        {
          "data": {
            "image": {
              "url": "https://samples.clarifai.com/metro-north.jpg"
            }
          }
        }
      ]
    });

    const requestOptions = {
      method: 'POST',
      headers: {
        'Accept': 'application/json',
        'Authorization': 'Key 93c052416161441e9a3db9c5122a28a0'
      },
      body: raw
    };

    fetch("https://api.clarifai.com/v2/models/face-detection/outputs", requestOptions)
      .then(response => response.text())
      .then(result => console.log(JSON.parse(result, null, 2).outputs[0].data.regions[0].region_info.bounding_box))
      .catch(error => console.log('error', error));
  }

