  }

  const particlesInit = async (main) => {
    await loadFull(main);
  };

  return (
    <div className="App">
      <Navigation />
      <Logo />
      <Rank />
      <ImageLinkForm 
        onInputChange={onInputChange} 
        onSubmit={onSubmit}/>
      <FaceRecognition imageUrl={imageUrl} />
      <Particles
        id="tsparticles"
        init={particlesInit}
        options={particlesOptions}
    />
    </div>
  );
}

export default App;
